import { Box } from '@material-ui/core';
import React from 'react';

const categories = [
  {
    title: 'Điện Thoại - Máy Tính Bảng',
    icon: 'flaticon-mobile-phone'
  },
  {
    title: 'Điện Tử - Điện Lạnh',
    icon: 'flaticon-monitor'
  },
  {
    title: 'Phụ Kiện - Thiết Bị Số',
    icon: 'flaticon-headphones'
  }
];

const Navigation = () => {
  return (
    <Box>
      {categories.map((category, key) => (
        <Box key={key} style={{ margin: '5px 0px' }}>
          <span
            className={category.icon}
            style={{ marginRight: 10, fontSize: 13, opacity: 0.9 }}
          ></span>
          <Box style={{ fontSize: 13, display: 'flex', alignItems: 'center' }}>
            {category.title}
          </Box>
        </Box>
      ))}
    </Box>
  );
};

export default Navigation;
